as Batman, there was GOTHAM. \\n\\nEveryone knows the name Commissioner Gordon. He is one of the crime world's greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordon's story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the world's most iconic villains? And what circumstances created them – the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker? \",\"poster_path\":\"\\/4XddcRDtnNjYmLRMYpbrhFxsbuq.jpg\"},{\"original_name\":\"フェアリーテイル\",\"genre_ids\":[16,35,10759,10765],\"name\":\"Fairy Tail\",\"popularity\":141.372,\"origin_country\":[\"JP\"],\"vote_count\":181,\"first_air_date\":\"2009-10-12\",\"backdrop_path\":\"\\/m2lugAG39sO0yCcuxEAu4fY5u1o.jpg\",\"original_language\":\"ja\",\"id\":46261,\"vote_average\":6.4,\"overview\":\"Lucy is a 17-year-old girl, who wants to be a full-fledged mage. One day when visiting Harujion Town, she meets Natsu, a young man who gets sick easily by any type of transportation. But Natsu isn't just any ordinary kid, he's a member of one of the world's most infamous mage guilds: Fairy Tail.\",\"poster_path\":\"\\/58GKcwFV3lpVOGzybeMrrNOjHpz.jpg\"},{\"original_name\":\"Supergirl\",\"genre_ids\":[28,12,18,878],\"name\":\"Supergirl\",\"popularity\":140.95,\"origin_country\":[\"US\"],\"vote_count\":977,\"first_air_date\":\"2015-10-26\",\"backdrop_path\":\"\\/3x1lVyxtsLKsZyR2E3qRe1EAXG4.jpg\",\"original_language\":\"en\",\"id\":62688,\"vote_average\":5.8,\"overview\":\"Twenty-four-year-old Kara Zor-El, who was taken in by the Danvers family when she was 13 after being sent away from Krypton, must learn to embrace her powers after previously hiding them. The Danvers teach her to be careful with her powers, until she has to reveal them during an unexpected disaster, setting her on her journey of heroism.\",\"poster_path\":\"\\/vqBsgL9nd2v04ZvCqPzwtckDdFD.jpg\"},{\"original_name\":\"ハンターｘハンター\",\"genre_ids\":[16,35,10759],\"name\":\"Hunter x Hunter\",\"popularity\":139.616,\"origin_country\":[\"JP\"],\"vote_count\":121,\"first_air_date\":\"2011-10-02\",\"backdrop_path\":\"\\/ye4oayd3csx8psElvvQPdO2fgdD.jpg\",\"original_language\":\"ja\",\"id\":46298,\"vote_average\":8.3,\"overview\":\"Twelve-year-old Gon Freecss one day discovers that the father he had always been told was dead was alive and well. His Father, Ging, is a Hunter—a member of society's elite with a license to go anywhere or do almost anything. Gon, determined to follow in his father's footsteps, decides to take the Hunter Examination and eventually find his father to prove himself as a Hunter in his own right. But on the way, he learns that there is more to becoming a Hunter than previously thought, and the challenges that he must face are considered the toughest in the world.\",\"poster_path\":\"\\/yWBcBIO9OrF3E85C5Arols6QNnG.jpg\"},{\"original_name\":\"ナルト 疾風伝\",\"genre_ids\":[16,35,18],\"name\":\"Naruto Shippūden\",\"popularity\":133.528,\"origin_country\":[\"JP\"],\"vote_count\":227,\"first_air_date\":\"2007-02-15\",\"backdrop_path\":\"\\/c14vjmndzL9tBdooGsMznMFrFLo.jpg\",\"original_language\":\"ja\",\"id\":31910,\"vote_average\":7.5,\"overview\":\"Naruto Shippuuden is the continuation of the original animated TV series Naruto.The story revolves around an older and slightly more matured Uzumaki Naruto and his quest to save his friend Uchiha Sasuke from the grips of the snake-like Shinobi, Orochimaru. After 2 and a half years Naruto finally returns to his village of Konoha, and sets about putting his ambitions to work, though it will not be easy, as He has amassed a few (more dangerous) enemies, in the likes of the shinobi organization; Akatsuki.\",\"poster_path\":\"\\/zAYRe2bJxpWTVrwwmBc00VFkAf4.jpg\"}]}"
